var allfaresjson = {};

//store station fares into dictionary of departure with dictionary of destination format
function store(record) {
    depart = record['Departure_Station'];
    //departc = stationNames[depart];
    dest = record['Destination_Station'];
    //destc = stationNames[dest];
    tchild = record['Taipei City Children'];
    senior = record['Senior, Charity, Companion and New Taipei City Children'];
    adult = record['Adult/Full Fare Tickets'];
    if (depart in allfaresjson) {
        allfaresjson[depart][dest] = [tchild, senior, adult];
        //allfaresjson[departc][destc] = [tchild, senior, adult];
    } else {
        allfaresjson[depart] = {};
        allfaresjson[depart][dest] = [tchild, senior, adult];
    };
}
